/*
 * Whirled - A Less White Whirled
 *
 * Author      : Shango
 * Updated     : October 16th, 2009
 * Description : Slightly modifies the colors of Whirled (http://www.whirled.com/) to make it look less stark
 * Usage       : Use with the Stylish Firefox extension (http://userstyles.org/) or copy to your Firefox userContent.css file
 */

@-moz-document
  domain("www.whirled.com")
{

.standardPage, .frameHeaderStatus {
  background-color: #EBF3FA !important;
}

.noclient {
  background: url("data:image/gif;base64,") no-repeat right !important;
}

.noclient img {
  display: none !important;
}

.noclient div:first-child {
  background-color: #000000 !important;
  background: url("data:image/gif;base64,") no-repeat !important;
  width: 81px !important;
  height: 95px !important;
}

.noclient div:first-child:hover {
  background: url("data:image/gif;base64,") no-repeat !important;
}

.statusPanel .TopBoxLinks a:hover, .pageTitle .SubNavi a:hover {
  text-decoration: underline !important;
}

.frameHeaderNavi .NaviButton {
  background: url(http://www.whirled.com/images/header/navi_button_bg.png) no-repeat !important;
  color: #489BCC !important;
}

.frameHeaderNavi .NaviButtonSelected {
  background: url("data:image/png;base64,") no-repeat !important;
  color: white !important;
}

.frameHeaderLogo {
  background: url("data:image/png;base64,") no-repeat !important;
}

}
